import React from 'react';
import './Card.css';

const Card = (props) => {
	return (
		<div className='cardDesc bg-white'>

				<img alt='photos'src={props.image}/>
				<h2>{props.name}</h2>
				<p> {props.address} </p>
				<p> {props.floor} </p>
				<h2> Floors </h2>
				<p> UG : {props.floorUG}</p>
				<p> G  : {props.floorUG}</p>
				<p> 1ST : {props.floorUG}</p>
				<p> 2ND : {props.floorUG}</p>
				<p> 3RD : {props.floorUG}</p>

				<h2> ____________ </h2>


		</div>
		);
}

export default Card;
